delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `AddUserInfo`(
IN `P_USERNO` varchar(16),
IN `P_TELNO` varchar(16),
IN `P_TRADEPWD` varchar(64),
`P_PARENTNO` varchar(16),
IN `P_TJNO` varchar(16),
IN `P_CLEVEL` INTEGER,
`P_DETYPE` varchar(30),
`P_IP` varchar(30),
`P_DEVNO` varchar(64),
`P_NICKNAME` varchar(64),
`P_LOGOADDR` varchar(256),
`P_OPENID` varchar(64),
IN P_UNO1 varchar(16),IN  P_UNO2 varchar(16),IN P_UNO3 varchar(16),IN P_UNO4 varchar(16),IN P_UNO5 varchar(16),IN P_UNO6 varchar(16),IN P_UNO7 varchar(16),IN P_UNO8 varchar(16),IN P_UNO9 varchar(16),IN P_UNO10 varchar(16),IN P_UNO11 varchar(16),IN P_UNO12 varchar(16),IN P_UNO13 varchar(16),IN P_UNO14 varchar(16))
STARTLAB:BEGIN
	declare cnum integer;
	declare ordstatus varchar(1);
	declare curfdate varchar(30);
	declare curtime varchar(30);
	
	declare msg varchar(500);
	declare P_RETNO VARCHAR(5);
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		get diagnostics condition 1  msg = message_text;
		ROLLBACK;
		SELECT CONCAT('40',msg) as RETNO;
	END;

	set P_RETNO= '0';
	#检查 电话号码是否存在
	if P_TELNO <> '' then
			select count(1) into cnum from tb_hy_user where TELNO=P_TELNO;
	elseif P_OPENID <> '' then
			select count(1) into cnum from tb_hy_user where OPENID=P_OPENID;
	end if;
	if cnum >= 1 THEN
	   SELECT CONCAT('48,','') as RETNO;
		 LEAVE STARTLAB;
	end if;
	set curfdate = DATE_FORMAT( now( ), '%Y-%m-%d' );
	set curtime = DATE_FORMAT( now( ), '%Y-%m-%d %H:%i:%s' );
	#开启事务
	START TRANSACTION;

	telno,isvalid,type,detype,ipaddr,deviceno,NICKNAME,WEIXINNO) values(P_USERNO,P_USERNO,
	P_USERNO,P_TRADEPWD,P_TELNO,'Y','1',P_DETYPE,P_IP,P_DEVNO,P_NICKNAME,P_OPENID);

	cardtype,identification,telno,isvalid,regdate,NICKNAME,OPENID,LOGOADDR) values(P_USERNO,P_USERNO,'2', '0', '0', '',
	P_TELNO,'Y',curtime,P_NICKNAME,P_OPENID,P_LOGOADDR);

	
	#推荐人成长值+5
	#call UserGrowTask(2,P_TJNO,curfdate,curtime);
	#推荐人抽奖次数增加
	select count(1) into cnum from tb_jl_draw_num where USERNO=P_TJNO;
	if cnum = 1 then
		update tb_jl_draw_num set num=num+1 where USERNO=P_TJNO;
	else
	end if;

	#提交事务退出
	if P_RETNO = '0' THEN
		COMMIT;
		SELECT CONCAT('0,','') as RETNO;
	else
		ROLLBACK;
		SELECT CONCAT(P_RETNO,'') as RETNO;
	end if;
END
;
;;
delimiter ;

