-- ----------------------------
-- Procedure structure for DigitArt_OpenBox
-- ----------------------------
DROP PROCEDURE IF EXISTS `DigitArt_OpenBox`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `DigitArt_OpenBox`(
IN `P_FDATE` varchar(20),
IN `P_USERNO` varchar(16),
IN `P_WARENO` varchar(16),
IN `P_NUM` varchar(16),
IN `P_CONTNO` varchar(16)
)
STARTLAB:BEGIN
	#Routine body goes here...
	DECLARE l_artids VARCHAR(1024) default '';
	declare l_minartid,l_maxartid bigint default 0;
	declare l_artid bigint default 0;
	declare l_rand int default 0;
	declare l_num,l_opennum int default 0;
	declare l_contnum int default 0;
	declare l_artcont int default 0;
	declare msg varchar(500) default '';
	declare P_RETNO VARCHAR(5);

	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
	get diagnostics condition 1  msg = message_text;
		ROLLBACK;
		SELECT CONCAT('40##',msg) as RETNO;
	END;
	set P_RETNO = '0';
	
	set l_num = CONVERT(P_NUM,SIGNED);
	set l_opennum = l_num;
	
	set session transaction isolation level serializable;
	#set session transaction isolation level repeatable read;
	#开启事务
	START TRANSACTION;
	TRANSLAB:BEGIN
			#开盒次数
			set l_contnum = 0;
			select num-setnum into l_contnum from tb_jy_contract where contno=P_CONTNO and WARENO=P_WARENO and `STATUS`='5';
			if l_contnum is null or l_contnum < l_num then
				set P_RETNO = '74';
				LEAVE TRANSLAB;
			end if;
			select min(ARTID),max(ARTID) into l_minartid,l_maxartid from tb_hy_user_digitart where WARENO=P_WARENO and CARDSTATUS in ('0','1');
			if l_minartid is null or l_minartid <= 0 then
				set P_RETNO = '75';
				LEAVE TRANSLAB;
			end if;

			WHILE l_num > 0  DO
			  set l_artid = 0;
				set l_rand = ROUND(RAND()*(l_maxartid-l_minartid),0);
				select ARTID into l_artid from tb_hy_user_digitart 
												where WARENO=P_WARENO and CARDSTATUS in ('0','1') and ARTID = l_minartid+l_rand and ARTID not in(l_artids);
				if l_artid is null or l_artid <= 0 then
					#这个资产被占用 找个符合条件的
					select ARTID into l_artid from tb_hy_user_digitart 
												where WARENO=P_WARENO and CARDSTATUS in ('0','1') and ARTID <= l_maxartid and ARTID not in(l_artids) limit 1;
					if l_artid is null or l_artid <= 0 then
							set P_RETNO = '75';
							LEAVE TRANSLAB;
					end if;
				end if;
				#验证通过资产更新
				update tb_hy_user_digitart set CARDSTATUS='2',UPSTATUS='1', USERNO=P_USERNO where ARTID = l_artid;
				if LENGTH(l_artids) > 0 then
					set l_artids = CONCAT(l_artids,',');
				end if;
				set l_artids = CONCAT(l_artids,l_artid);	
				set l_num = l_num - 1;
			END WHILE;
			#更新抽奖记录
			if l_contnum = l_opennum then
						update tb_jy_contract set setnum=setnum+l_opennum,artid=l_artids,`STATUS`='6' where contno=P_CONTNO and WARENO=P_WARENO;
			else
						update tb_jy_contract set setnum=setnum+l_opennum,artid=l_artids,`STATUS`='5' where contno=P_CONTNO and WARENO=P_WARENO;
			end if;
	END;
	
	#提交事务
	if P_RETNO = '0' THEN
		COMMIT;
		SELECT CONCAT('0#',l_artids,'#') as RETNO;
	else
		ROLLBACK;
		SELECT CONCAT(P_RETNO,'##') as RETNO;
	end if;		
	
END
;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for PayOrder_Create
-- ----------------------------
DROP PROCEDURE IF EXISTS `PayOrder_Create`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `PayOrder_Create`(
IN `P_USERNO` varchar(16),
IN `P_PAYCHAN` varchar(2),
IN `P_BUSTYPE` varchar(3),
IN `P_CHMONEY` varchar(20),
IN `P_FDATE` varchar(20),
IN `P_TIME` varchar(30),

IN `P_ACCT101` DECIMAL ( 15, 2 ),
IN `P_ACCT100` DECIMAL ( 15, 2 ),
IN `P_ACCT102` DECIMAL ( 15, 2 ),
IN `P_PAYTYPE` VARCHAR ( 1 ),
IN `P_TICKETNO` VARCHAR ( 16 ),
IN `P_CONTNO` VARCHAR ( 16 ),
IN `P_LOGINNO` varchar(16),
IN `P_IP` varchar(64))
DBLAB:BEGIN
	#Routine body goes here...
	DECLARE maxwaterno bigint;
	DECLARE sacctno varchar(5);
	DECLARE spaystatus varchar(5);
	DECLARE denable DECIMAL ( 15, 2 ) DEFAULT 0;
	declare sopenid varchar(64) default '';
	
	declare msg varchar(500);
	declare P_RETNO VARCHAR(5);
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		get diagnostics condition 1  msg = message_text;
		ROLLBACK;
		SELECT CONCAT('40,',msg,',') as RETNO;
	END;	
	set P_RETNO = '0';
	
	if P_ACCT100 > 0 THEN
		set sacctno='100';
		set spaystatus = '100';
	elseif P_ACCT101 > 0 THEN
		set sacctno='101';
		set spaystatus = '200';
	elseif P_ACCT102 > 0 THEN
		set sacctno='102';
		set spaystatus = '200';
	end if;
	if P_PAYCHAN = 'C' then
		select OPENID into sopenid from tb_hy_user where USERNO = P_USERNO;
		if sopenid is null or sopenid = '' then
				SELECT '71,,' as RETNO;
				LEAVE DBLAB;
		end if;
	end if;
	#开启事务
	START TRANSACTION;	
	TRANSLAB:BEGIN
	
	#插入支付订单
	IF P_PAYTYPE = 'A' THEN
		#判断资金是否够
		SELECT
			`ENABLE` INTO denable 
		FROM
			tb_zj_usermoney 
		WHERE
			P_FDATE=FDATE AND P_USERNO = USERNO AND ACCTNO = sacctno;

		if P_ACCT100 > 0 THEN	
			IF denable < P_ACCT100 + P_TRANSCOMM THEN
				SET P_RETNO = 29;
				ROLLBACK;#事务回滚
				SELECT '29,,' as RETNO;
				LEAVE DBLAB;
			END IF;
		elseif P_ACCT101 > 0 THEN	
				IF denable < P_ACCT101 THEN
					SET P_RETNO = 29;
					ROLLBACK;#事务回滚
					SELECT '29,,' as RETNO;
					LEAVE DBLAB;
				END IF;
		elseif P_ACCT102 > 0 THEN	
				IF denable < P_ACCT102 THEN
					SET P_RETNO = 29;
					ROLLBACK;#事务回滚
					SELECT '29,,' as RETNO;
					LEAVE DBLAB;
				END IF;			
		end if;
	END IF;	
	#生成支付订单P_BUSTYPE
	if P_PAYTYPE = 'B' AND P_ACCT100 > 0 then
									VALUES(P_FDATE,P_USERNO,'100',P_CHMONEY,P_BUSTYPE,P_CONTNO,'B','100','',P_PAYCHAN,'',P_TIME,'','',sopenid,P_IP);
		set maxwaterno = LAST_INSERT_ID();
		if P_BUSTYPE = '3' or P_BUSTYPE = '31' or P_BUSTYPE = '6' or P_BUSTYPE = '61' or P_BUSTYPE = '62' then
				update tb_jy_contract set ZJWATER = maxwaterno where CONTNO=P_CONTNO;
		end if;
		
	end if;
	/*
	#更新资金相关
	IF P_PAYTYPE = 'A' AND P_ACCT100 > 0 THEN
						VALUES( P_FDATE, P_USERNO, '100', '103', P_ACCT100, 0, 0, P_CONTNO, 'A', '200', P_OTIME, '现金购物', '' );
		UPDATE tb_zj_usermoney 
			SET `ENABLE` = `ENABLE` - ACCT100,
			BALANCE = BALANCE - ACCT100,
			CANOUT = CANOUT - ACCT100,
			`OUT` = `OUT` + ACCT100 
		WHERE
			FDATE=P_FDATE 
			AND USERNO = P_USERNO 
			AND ACCTNO = '100';
	END IF;
	IF P_ACCT101 > 0 THEN
						VALUES( P_FDATE, P_USERNO, '101', '103', P_ACCT101, 0, 0, P_CONTNO, 'A', '200', P_OTIME, '积分购物', '' );
		UPDATE tb_zj_usermoney 
			SET `ENABLE` = `ENABLE` - P_ACCT101,
			BALANCE = BALANCE - P_ACCT101,
			CANOUT = CANOUT - P_ACCT101,
			`OUT` = `OUT` + P_ACCT101 
		WHERE
			FDATE=P_FDATE 
			AND USERNO = P_USERNO 
			AND ACCTNO = '101';
	END IF;
	IF P_ACCT102 > 0 THEN
					VALUES( P_FDATE, P_USERNO, '102', '103', P_ACCT102, 0, 0, P_CONTNO, 'A', '200', P_OTIME, '钻石购物', '' );
		UPDATE tb_zj_usermoney 
			SET `ENABLE` = `ENABLE` - P_ACCT102,
			BALANCE = BALANCE - P_ACCT102,
			CANOUT = CANOUT - P_ACCT102,
			`OUT` = `OUT` + P_ACCT102 
		WHERE
			FDATE=P_FDATE 
			AND USERNO = P_USERNO 
			AND ACCTNO = '102';
	END IF;	
	*/
	END;
	
	#提交事务退出
	if P_RETNO = '0' THEN
		COMMIT;
		SELECT CONCAT('0,',',',maxwaterno) as RETNO;
	else
		ROLLBACK;
		SELECT CONCAT(P_RETNO,',,') as RETNO;
	end if;	
END
;
;;
delimiter ;

