-- ----------------------------
-- Procedure structure for UserWareFollow
-- ----------------------------
DROP PROCEDURE IF EXISTS `UserWareFollow`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `UserWareFollow`(
IN `P_OPTYPE` varchar(1),
IN `P_USERNO` varchar(16),
IN `P_WARENO` varchar(16),
IN `P_STIME` varchar(50))
BEGIN
	#Routine body goes here...
	declare curfdate varchar(30);
	declare curtime varchar(30);
	declare cnum int;
	
	declare msg varchar(500);
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		get diagnostics condition 1  msg = message_text;
		SELECT CONCAT('40,',msg) as RETNO;
	END;

	set curfdate = DATE_FORMAT( now( ), '%Y-%m-%d' );
	set curtime = DATE_FORMAT( now( ), '%Y-%m-%d %T' );
	
	if P_OPTYPE = '2' then
			delete from tb_jy_ware_follow where userno=P_USERNO and wareno=P_WARENO;
	elseif P_OPTYPE = '1' then
					select P_USERNO,P_WARENO,P_STIME,t.SPRICE,t.TITLE from tb_jy_ware_jj t where WARENO = P_WARENO;
	end if;
	
	#关注成长值+5
	call UserGrowTask(4,P_USERNO,curfdate,curtime);
	
	SELECT CONCAT('0,','') as RETNO;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ZJChangeMoney
-- ----------------------------
DROP PROCEDURE IF EXISTS `ZJChangeMoney`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ZJChangeMoney`(
IN `P_FDATE` varchar(20),
IN `P_USERNO` varchar(16),
IN `P_ACCTNO` varchar(5),
IN `P_SUBJECTNO` varchar(5),
IN `P_CHMONEY` decimal(15,2),
IN `P_CONTNO` varchar(30),
IN `P_PAYTYPE` varchar(1),
IN `P_PAYCHAN` varchar(1),
IN `P_OTIME` varchar(30),
IN `P_MEMO` varchar(100),
IN `P_OPPUSERNO` varchar(16)
)
STARTLAB:BEGIN
	#Routine body goes here...
	DECLARE denable decimal(15,2);
	declare dout decimal(15,2);
	declare msg varchar(500);

	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
	get diagnostics condition 1  msg = message_text;
		ROLLBACK;
		SELECT CONCAT('40,,,',msg) as RETNO;
	END;
	
	#开启事务
	START TRANSACTION;
	#判断可用可出是否够
	if P_SUBJECTNO IN ('101','103','104','106') THEN
	SELECT 
		IFNULL(`ENABLE`,0),IFNULL(`CANOUT`,0) into  denable,dout 
	from tb_zj_usermoney 
		where FDATE=P_FDATE and USERNO=P_USERNO and ACCTNO=P_ACCTNO;
	if denable < P_CHMONEY then
		ROLLBACK;
		SELECT CONCAT('44,',denable,',',P_ACCTNO,',') as RETNO;
		LEAVE STARTLAB;
	end if;
	if P_ACCTNO='101' and dout < P_CHMONEY then
		ROLLBACK;
		SELECT CONCAT('45,',dout,',',P_ACCTNO,',') as RETNO;
		LEAVE STARTLAB;
	end if;
	END IF;
	#插入变动 修改客户资金
			CHMONEY, BEFMONEY, AFTMONEY, CONTNO,  PAYSTATUS, CTIME, MEMO, EXTEN )
	VALUES
			( P_FDATE, P_USERNO, P_ACCTNO, P_SUBJECTNO, P_CHMONEY, 0, 0, P_CONTNO,  '200', P_OTIME, P_MEMO,'');
			
	#收入的话看记录是否存在
	if P_SUBJECTNO IN ('100','102','105') THEN
		UPDATE tb_zj_usermoney 
				SET `ENABLE` = `ENABLE` + P_CHMONEY,
				BALANCE = BALANCE + P_CHMONEY,
				CANOUT = CANOUT + P_CHMONEY,
				`IN` = `IN` + P_CHMONEY 
		WHERE
				FDATE=P_FDATE 
				AND USERNO = P_USERNO 
				AND ACCTNO = P_ACCTNO;
		if ROW_COUNT()<=0 then
					OUTMONEY,`IN`,`OUT`,INCOME,PAYMENT,BALANCE,FREEZE,LOSE,`ENABLE`,ALLQUITY,LIMTOUT,CANOUT) 
			VALUES(P_FDATE,P_USERNO,P_ACCTNO,0,P_CHMONEY,0,0,0,0,0,P_CHMONEY,0,0,P_CHMONEY,P_CHMONEY,0,P_CHMONEY);
		end if;					
	elseif P_SUBJECTNO IN ('101','103','104','106') THEN
		UPDATE tb_zj_usermoney 
				SET `ENABLE` = `ENABLE` - P_CHMONEY,
				BALANCE = BALANCE - P_CHMONEY,
				CANOUT = CANOUT - P_CHMONEY,
				`OUT` = `OUT` + P_CHMONEY 
		WHERE
				FDATE=P_FDATE 
				AND USERNO = P_USERNO 
				AND ACCTNO = P_ACCTNO;
		if ROW_COUNT()<=0 then
				OUTMONEY,`IN`,`OUT`,INCOME,PAYMENT,BALANCE,FREEZE,LOSE,`ENABLE`,ALLQUITY,LIMTOUT,CANOUT) 
		VALUES(P_FDATE,P_USERNO,P_ACCTNO,0,0,P_CHMONEY,0,0,0,P_CHMONEY,0,0,0,P_CHMONEY,P_CHMONEY,0,P_CHMONEY);
	end if;	
	end if;		
	#对方收款
	if P_OPPUSERNO <> '' then
			CHMONEY, BEFMONEY, AFTMONEY, CONTNO, PAYSTATUS, CTIME, MEMO, EXTEN )
	VALUES
			( P_FDATE, P_OPPUSERNO, P_ACCTNO, '102', P_CHMONEY, 0, 0, P_CONTNO, '200', P_OTIME, '积分收入','');
		UPDATE tb_zj_usermoney 
				SET `ENABLE` = `ENABLE` + P_CHMONEY,
				BALANCE = BALANCE + P_CHMONEY,
				CANOUT = CANOUT + P_CHMONEY,
				`IN` = `IN` + P_CHMONEY 
		WHERE
				FDATE=P_FDATE 
				AND USERNO = P_OPPUSERNO 
				AND ACCTNO = P_ACCTNO;
		if ROW_COUNT()<=0 then
					OUTMONEY,`IN`,`OUT`,INCOME,PAYMENT,BALANCE,FREEZE,LOSE,`ENABLE`,ALLQUITY,LIMTOUT,CANOUT) 
			VALUES(P_FDATE,P_OPPUSERNO,P_ACCTNO,0,0,
				0,P_CHMONEY,0,0,0,P_CHMONEY,0,0,P_CHMONEY,P_CHMONEY,0,P_CHMONEY);
		end if;				
	end if;

	#提交事务
	COMMIT;
	SELECT '0,0,0,0' as RETNO;
END
;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ZjContOver
-- ----------------------------
DROP PROCEDURE IF EXISTS `ZjContOver`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ZjContOver`(IN `OldDate` varchar(30),IN `NewDate` varchar(30))
BEGIN
	declare msg varchar(500);
	declare P_RETNO VARCHAR(5);
	declare l_contno varchar(16);
	declare l_userno varchar(16);	
	declare l_interew DECIMAL(15,2);
	declare l_intfreeze DECIMAL(15,2);
	declare l_paraval DECIMAL(15,2);
	declare l_money DECIMAL(15,2);
	declare l_time varchar(30);

	# 游标结束的标志
	declare done int default 0;
	# 声明游标INTFREEZE
	declare cur cursor for select CONTNO,USERNO,INTEREW,INTFREEZE,t1.PARAVAL
													from tb_jy_contract t 
													left join tb_jy_ware_para t1 
													on t.WARENO = t1.WARENO and t1.PARANO='0004' 
													where t.INTFREEZE>0;
	# 指定游标循环结束时的返回值 
	declare continue handler for not found
	BEGIN
		 set done = 1;
	END;
	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		get diagnostics condition 1  msg = message_text;
		ROLLBACK;
		SELECT CONCAT('40',msg) as RETNO;
	END;

	set P_RETNO= '0';
	#开启事务
	START TRANSACTION;
	
	#Routine body goes here...
		
	
	set l_time = DATE_FORMAT(now(),'%Y-%m-%d %H:%i:%s');
	# 打开游标
	open cur;
	# while 循环
	while done != 1 do
			fetch cur into l_contno,l_userno,l_interew,l_intfreeze,l_paraval;
			if done != 1 then
				 set l_money = floor(l_interew*l_paraval/100+0.5);
				 if l_money > l_intfreeze then 
						set l_money = l_intfreeze;
				 end if;
				 if l_money > 0 then
						update tb_jy_contract set intfreeze=intfreeze-l_money where CONTNO=l_contno;
						
								BEFMONEY, AFTMONEY, CONTNO, PAYTYPE, PAYSTATUS, CTIME, MEMO, EXTEN )
						VALUES ( NewDate, l_userno, '101', '105', l_money, 0, 0,
							l_contno, 'A', '200', l_time, '购物赠送积分解冻', '' );

						UPDATE tb_zj_usermoney 
							SET `ENABLE` = `ENABLE` + l_money,
							BALANCE = BALANCE + l_money,
							CANOUT = CANOUT + l_money,
							FREEZE = FREEZE - l_money
						WHERE
							FDATE=NewDate 
							AND USERNO = l_userno 
							AND ACCTNO = '101';							
				 end if;
			end if;    
	end while;
	# 关闭游标
	close cur;	
	
	#提交事务退出
	if P_RETNO = '0' THEN
		COMMIT;
		SELECT CONCAT('0,','') as RETNO;
	else
		ROLLBACK;
		SELECT CONCAT(P_RETNO,',') as RETNO;
	end if;
	
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ZJReqOutMoney
-- ----------------------------
DROP PROCEDURE IF EXISTS `ZJReqOutMoney`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `ZJReqOutMoney`(
