			SET `ENABLE` = `ENABLE` - P_CHMONEY,
			BALANCE = BALANCE - P_CHMONEY,
			CANOUT = CANOUT - P_CHMONEY,
			`OUT` = `OUT` + P_CHMONEY 
	WHERE
			FDATE=P_FDATE 
			AND USERNO = P_USERNO 
			AND ACCTNO = '100';		
			*/
	update tb_hy_user set ALINO=P_RECCUSTNO WHERE USERNO=P_USERNO;
	#提交事务
	COMMIT;
	SELECT CONCAT('0,',maxno) as RETNO;
END
;
;;
